(1, 'ESARETİN BEDELİ', 'Orijinal İsmi: The Shawshank Redemption Süre: 142dk Tür: Dram , Polisiye , Suç Senarist: Stephen King , Frank Darabont Yönetmen: Frank Darabont Yapımı:  ABD', 'Genç ve başarılı bir bankacı olan Andy Dufresne, karısını ve onun sevgilisini öldürmek suçundan ömür boyu hapse mahkum edilir ve Shawshank hapishanesine gönderilir. Burada başta Red olmak üzere yeni arkadaşlar edinir. Hapishane yaşamını uyum sağlamaya çalışırken diğer yandan da bilgisi ve kültürüyle etrafındaki insanları etkilemeyi başaracaktır.', 'Tim Robbins ,Morgan Freeman ,Bob Gunton, Clancy Brown', );
INSERT INTO `filmbilgi` (`id`, `film`, `bilgi`, `konu`, `oyuncular`, `image`) VALUES
(2, 'KARA ŞÖVALYE', 'Orijinal İsmi: The Dark Knight Süre: 152dk Tür: Aksiyon , Dram , Suç Yönetmen: Christopher Nolan Senarist: Christopher Nolan , Jonathan Nolan , David S. Goyer , Bob Kane Yapımı: İngiltere ,  ABD', 'The Dark Knight\'da, Batman suça karşı savaşını daha da ileriye götürüyor: Teğmen Jim Gordon ve Bölge Savcısı Harvey Dent’in yardımlarıyla, Batman, şehir sokaklarını sarmış olan suç örgütlerinden geriye kalanları temizlemeye girişir. Bu ortaklığın etkili olduğu açıktır, ama ekip kısa süre sonra kendilerini, Joker olarak bilinen ve Gotham şehri sakinlerini daha önce de dehşete boğmuş olan suç dehasının yarattığı karmaşanın ortasında bulurlar.', 'Christian Bale, Heath Ledger, Morgan Freeman Michael Caine, Maggie Gyllenhaal', );
INSERT INTO `filmbilgi` (`id`, `film`, `bilgi`, `konu`, `oyuncular`, `image`) VALUES
(3, 'DÖVÜŞ KULÜBÜ', 'Orijinal İsmi: Fight Club Süre: 139dk Tür: Dram Yönetmen: David Fincher , Chon Kye-Young Senarist: Jim Uhls Yapımı:  ABD ,  Almanya', 'Oregon Üniversitesinde yüksek lisansını yapan Chuck Palanhiuk\'un uzak olmayan bir gelecekte geçen ve kafası karışık genç bir erkeği konu alan romanından yola çıkılarak çekilen Fight Club\'da filmi anlatan, ünlü bir otomobil firmasında iyi bir işe sahiptir. Tek düze yaşamı kronik uykusuzluk sorunuyla çekilmez bir hale gelmiştir. Ailesi ve yakın bir arkadaşı olmayan Jack doktorunun tavsiyesi üzerine kanserli hastaların terapi grubuna katılır. Bu toplantılar esnasında Marla\'yla tanışır o da genç adam gibi hasta olmadığı halde grubun toplantılarına katılmaktadır. Jack\'in ve Marla\'nın çabaları tüket', 'Brad Pitt ,Edward Norton, Meat Loaf ,Helena Carter, Jared Leto', );
INSERT INTO `filmbilgi` (`id`, `film`, `bilgi`, `konu`, `oyuncular`, `image`) VALUES
(4, 'BAŞLANGIÇ', 'Orijinal İsmi: Inception Süre: 148dk Tür: Bilim Kurgu , Aksiyon Yönetmen: Christopher Nolan Senarist: Christopher Nolan Yapımı:  İngiltere ,  ABD', 'Dom Cobb (Leonardo DiCaprio) çok yetenekli bir hırsızdır. Uzmanlık alanı, zihnin en savunmasız olduğu rüya görme anında, bilinçaltının derinliklerindeki değerli sırları çekip çıkarmak ve onları çalmaktır. Cobb’un bu ender mahareti, onu kurumsal casusluğun tehlikeli yeni dünyasında aranan bir oyuncu yapmıştır. Ancak, aynı zamanda bu durum onu uluslararası bir kaçak yapmış ve sevdiği herşeye malolmuştur. Cobb’a içinde bulunduğu durumdan kurtulmasını sağlayacak bir fırsat sunulur. Ona hayatını geri verebilecek son bir iş; tabi eğer imkansız başlangıçı tamamlayabilirse... Mükemmel soygun yerine, C', 'Leonardo DiCaprio, Marion Cotillard, Joseph Gordon-Levitt Elliot Page', );
INSERT INTO `filmbilgi` (`id`, `film`, `bilgi`, `konu`, `oyuncular`, `image`) VALUES
(5, '3 AHMAK', 'Orijinal İsmi: 3 Idiots Süre: 170dk Tür: Dram , Komedi , Romantik Yönetmen: Rajkumar Hirani Senarist: Rajkumar Hirani , Abhijit Joshi Yapımı: Hindistan', 'Hindistan\'ın en iyi mühendislik okuluna başlayan öğrencilerin hayatını anlatıyor özet olarak. Sistemin daima yarış üzerine kurulu olduğu, herkesin en iyi olmaya çabaladığı bir okulda sistemi değiştirmeye çalışan bir öğrenci ve onun en yakın 2 arkadaşı. Başlarından geçenler, hayattan aslında ne istedikleri. Ranco karakterinin başrol oynadığı film dram ve komedi türünü en iyi şekilde harmanlayıp bize öğretici bir film olmakta.', 'Aamir Khan, Kareena Kapoor, Sharman Joshi, Madhavan', );
